WTF, Wikipedia: Com base num artigo publicado há menos de 1 hora (https://g1.globo.com/mundo/noticia/2022/12/07/quem-e-pedro-castillo.ghtml), a Wikipedia muda o partido de Castillo, que sempre foi marxista (https://archive.ph/1A7Ni), para um partido conservador (https://pt.wikipedia.org/wiki/Peru_Livre)

Numa tentativa mal sucedida de colocar uma narrativa de golpe no conservadorismo, os membros da Wikipedia utilizaram as suas ferramentas para assimilar (https://pt.wikipedia.org/w/index.php?title=Peru_Livre&action=history) o partido de Castillo, que foi preso por tentar encenar um golpe de estado no Peru.

Não é a primeira vez que a Wikipédia faz algo assim (https://noticias.uol.com.br/ultimas-noticias/agencia-estado/2022/11/13/prf-notifica-wikipedia-para-apagar-pagina-que-chama-silvinei-de-bolsonarista.htm), e não será a última.

